import React from 'react';

import ButtonSmall from '../../UserInterface/Buttons/Button/ButtonSmall';
import ButtonLinkSmall from '../../UserInterface/Buttons/Button/ButtonLinkSmall';


function ConsoleButton (props){
    
    const stateButton = props.stateConsoleButton;

    const buttonsDescription = {
        [stateButton[0].name]: stateButton[0].text,
        [stateButton[1].name]: stateButton[1].text,
        [stateButton[2].name]: stateButton[2].text,
        [stateButton[3].name]: stateButton[3].text,
        [stateButton[4].name]: stateButton[4].text
    };

    console.log('buttonsDescription', buttonsDescription);
    return(
        <div className='DataBase__header__console'>
            <ButtonSmall 
                    onclick={stateButton[0].onclick}
                    tabindex = "-1"
                    text = {stateButton[0].text}
                    icon = {stateButton[0].icon}
                />
            <ButtonLinkSmall 
                    to={stateButton[1].link}
                    onclick={stateButton[1].onclick}
                    tabindex="-1"
                    text = {stateButton[1].text}
                    icon = {stateButton[1].icon}
            />
                <ButtonLinkSmall
                    to={stateButton[2].link}
                    onclick={stateButton[2].onclick}
                    tabindex="-1"
                    text={stateButton[2].text}
                    icon={stateButton[2].icon}
                />
                <ButtonLinkSmall
                    to={stateButton[3].link}
                    onclick={stateButton[3].onclick}
                    tabindex="-1"
                    text={stateButton[3].text}
                    icon={stateButton[3].icon}
                />
            <ButtonLinkSmall
                    to={stateButton[4].link}
                    onclick={stateButton[4].onclick}
                    tabindex="-1"
                    text={stateButton[4].text}
                    icon={stateButton[4].icon}
                />
  

        </div>
    )
}

export default ConsoleButton
